import React, { Component, createContext } from 'react'
import '../App.css'


class Head extends React.Component {
    constructor(props) {
      super(props);
    
  
    }
  
   
  
    render() {
      return (
        <header>
        <div class="main">
            
        <ul>
                <li><a href="#">Swift</a></li>
                <li><a href="#">VARIANTS</a></li>
                <li><a href="#">360 VIEW</a></li>
                <li><a href="#">IMAGESS</a></li>
            </ul>
           
        </div>
    </header>
      );
    }
  }
  



export default Head;
